import React from "react";
import styled from "styled-components";
import colors from "./../../theme/colors";

const StyledHeader = styled.header`
  position: absolute;
  left: 50%;
  transform: translate(-50%, -100%);
`;

const Logo = () => {
  return (
    <StyledHeader>
      <h1>GATECH Task</h1>
    </StyledHeader>
  );
};

export default Logo;
